import React from 'react';

const Movie = (props) => {

    console.log(props);
    // console.log(props.match.params.id + " " + props.match.params.title)

    const data = props.location.params.map(data => {
        return (
            <div>
                {data}
            </div>
        );
    })

    return(
        <div>
            <h3>{props.match.params.id} {props.match.params.title}</h3>
        </div>
    );
}

export default Movie;
